import React, { useEffect, useState } from 'react'; 
import { Link, useNavigate } from 'react-router-dom';
import Swal from 'sweetalert2';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Home.css'; // Asegúrate de crear este archivo para estilos personalizados

const Home = () => {
    const [personas, setPersonas] = useState([]);
    const [error, setError] = useState('');
    const navigate = useNavigate();

    useEffect(() => {
        loadPersonas();
    }, []);

    const loadPersonas = async () => {
        try {
            const token = localStorage.getItem('token');
            const response = await fetch('http://localhost:9001/Laboratorio1/personas', {
                headers: {
                    'Authorization': `Bearer ${token}`
                }
            });
            const data = await response.json();
            setPersonas(data);
        } catch (error) {
            console.error("Error loading personas:", error);
            setError("Error al cargar las personas.");
        }
    };

    const handleDelete = async (id) => {
        // Código de manejo de eliminación...
    };

    const handleLogout = () => {
        // Código de manejo de cierre de sesión...
    };

    return (
        <div className="container mt-5 home-background">
            <h1 className="mb-4">Bienvenido a la aplicación</h1>
            <button className="btn btn-danger mb-3 hover-effect" onClick={handleLogout}>Cerrar Sesión</button>
            {error && <div className="alert alert-danger">{error}</div>}
            <table className="table table-striped">
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Primer Nombre</th>
                        <th>Segundo Nombre</th>
                        <th>Primer Apellido</th>
                        <th>Segundo Apellido</th>
                        <th>Edad</th>
                        <th>Identificación</th>
                        <th>Email</th>
                        <th>Fecha de Nacimiento</th>
                        <th>Edad Clínica</th>
                        <th>Ubicación</th>
                        <th>Acciones</th>
                    </tr>
                </thead>
                <tbody>
                    {personas.length > 0 ? (
                        personas.map((persona) => (
                            <tr key={persona.id}>
                                <td>{persona.id}</td>
                                <td>{persona.primerNombre}</td>
                                <td>{persona.segundoNombre}</td>
                                <td>{persona.primerApellido}</td>
                                <td>{persona.segundoApellido}</td>
                                <td>{persona.edad}</td>
                                <td>{persona.identificacion}</td>
                                <td>{persona.email}</td>
                                <td>{persona.fechaNacimiento}</td>
                                <td>{persona.edadClinica}</td>
                                <td>
                                    {persona.ubicacion ? `${persona.ubicacion.lugar}, ${persona.ubicacion.ciudad}, ${persona.ubicacion.departamento}` : 'No disponible'}
                                </td>
                                <td>
                                    <Link to={`/update/${persona.id}`} className="btn btn-primary me-2 hover-effect">Actualizar</Link>
                                    <button className="btn btn-danger hover-effect" onClick={() => handleDelete(persona.id)}>Eliminar</button>
                                </td>
                            </tr>
                        ))
                    ) : (
                        <tr>
                            <td colSpan="12" className="text-center">No hay personas disponibles.</td>
                        </tr>
                    )}
                </tbody>
            </table>
            <Link to="/map" className="btn btn-secondary hover-effect">Ver Ubicaciones en Mapa</Link>
        </div>
    );
};

export default Home;
